import React from 'react'
import './Header.css'

export const Header = () => {
  return (
    <header>
        <div className='logo'>
            <img src="https://cdn.discordapp.com/attachments/1008571193621757962/1058077714768207904/shushant_smart_city_related_issues_and_pollution_tracker_logo_f_64929c32-0638-48e8-a510-c484c1c1030a.png" alt="" />
        </div>
    </header>
  )
}
